Query multiple indices in MongoDB array<p>I want to query some specific non-consecutive indexes of an array in a MongoDB document.<br>
The options I have considered are:<br></p>
<ol>
<li>Query the entire array, then filter by index in client script. This isn't viable as for a large array it will result in fetching unwanted items from the database (Suppose I need only index 5 and 20, but there are actually 1000 items in the array).</li>
<li>Using $slice multiple times picking every time each of the indices I want from the array. But this results in N number of calls.</li>
